import './App.css';
import { STAFFS ,DEPARTMENTS } from './shared/staff';
import React, { Component } from 'react'
import {Navbar ,NavbarBrand ,Container, CardText} from 'reactstrap'
import MenuComponent from './Component/MenuComponent';
class App extends Component {
  constructor(props){
    super(props);
  }

  render() {
    return (
      <div >
      <Navbar dark  style ={{backgroundColor:'black'}}>
      <Container >
      <NavbarBrand > <b style={{color:"red"}}>Ứng Dụng Quản Lý Nhân Sự v1.0 </b></NavbarBrand>
      </Container>
      </Navbar>   
      <MenuComponent staffs = {STAFFS} department={DEPARTMENTS}/>
      <CardText>Bấm vào tên để xem thông tin </CardText>
        </div>
    )
  }
}
export default App;
